import React from "react";
import card from "./Card";
import Pokinfo from "./Pokinfo";
const Main=()=>{
    return(
        <>
           <div className="container">
            <div className="left-content">
               <Card/>
               <Card/>
               <Card/>
               <card/>
               <card/>
            </div>
             <div className="right-content">
                <Pokinfo/>
             </div>
           
           </div>
           
        </>

    )
}
export default Main;
